import { HeaderContainer, HeaderElement } from './Header.styles'
import TwitterLogo from '../../static/icons/twitter.svg'
import LinkedinLogo from '../../static/icons/linkedin.svg'
import GitHubLogo from '../../static/icons/github.svg'
// import IconChart from '../../chartComponents/IconChart/IconChart';

const Header = () => {

    return ( 
        <HeaderContainer>
            <img src='/static/icons/github.svg' alt='my image' />
        </HeaderContainer>
     );
}

export default Header;
